import React, { Component } from 'react';
import Header from '../../layouts/frontend/Header';
import Navbar from '../../layouts/frontend/Navbar';
import ScrollButton from '../../layouts/frontend/ScrollButton';

class Home extends Component {
    render() {
        return (
            <div>
                <Navbar />
                <Header />
                <h1>I am Home</h1>
                <ScrollButton />
            </div>
        );
    }
}

export default Home;
